備長炭ドライペット 引き出し・衣装ケース用 12シート入<br>ブランド：ドライペット<br>販売・製造元：エステー<br><br>湿気をとってしっかり脱臭する、備長炭&活性炭配合の除湿剤です。<br>除湿剤に備長炭と活性炭を配合しているので、衣類の収納時に湿気とニオイを吸い取ります。<br>薬剤がゼリー状になるので、除湿効果がひとめでわかります。<br>防虫剤ムシューダ・ネオパラなどと併用しますと、除湿・防虫の効果で衣類を守ります。<br> <br><br><br>使用方法<br>●白い吸湿面を必ず上に向け、衣類の一番上にそのまま置いてご使用ください。<br>(ポケットやバッグの中に入れて使用しないでください。<br>)●顆粒状の薬剤がゼリー状になったら、お取り替えください。<br>○除湿有効期間：3-4ヶ月(季節や湿気の状態によって異なります) ※1年以内に必ずお取り替えください。<br>○標準使用量：引き出し1袋(約500L)、衣装ケース1箱(約50L)に1シート○標準除湿量(水換算)：50g×2シート(25度、湿度80%の場合)○使用環境：できるだけ密閉性を高くした環境で使用してください。<br>○使用後の処理：使い終わったあとは、地域のゴミ捨て規則に従ってお捨てください。<br> <br><br>使用上の注意<br>●幼児のいたずら、誤食に注意する。<br>●本品は食べられない。<br>万一口に入れた場合は、すぐに吐き出させ、うがいをさせる。<br>また飲み込んだ場合は、水または牛乳を飲ませ、ただちに医師に相談する。<br>●薬剤が目に入らないように注意する。<br>万一目に入った場合は、流水で充分に洗ったうえで、ただちに医師に相談する。<br>●薬剤が皮膚、衣類や金属などについたり、こぼれた場合は水でよく洗い流す。<br>●薬剤を取り出したり、薬剤袋を乱暴に扱わない。<br>万一袋を傷つけた場合、使用を中止する。<br>液が漏れ衣類を汚したり、皮製品を変質させるおそれがある。<br>●白い吸湿面を汚したり、ぬらしたりしない。<br>液が染み出す原因となる。<br>●用途以外に使用しない。<br>●使用中はこの袋を保管する。<br> 保存方法直射日光及び高温多湿のところを避けて、密封したまま保存してください。<br>本品は開封すると吸湿するので、未使用分はファスナーをしっかり閉めて保存してください。<br> <br>成分<br>塩化カルシウム、保水剤、活性炭、備長炭<br> 原産国日本 <br><br>お問い合わせ先<br>エステー株式会社 お客様相談室TEL：03-3367-2120 <br>日用品／家庭用品／除湿剤・乾燥剤／除湿剤 タンス用<br>JANコード： 4901070909254<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
