お部屋の消臭力 寝室用 アロマカモミール 400ml<br>ブランド：お部屋の消臭力<br>販売・製造元：エステー<br><br>ミネラル消臭と植物エキス成分を配合し、すばやく、強力に消臭する消臭剤です。<br>お部屋のイヤなニオイを強力に消臭し、ほのかな香りが漂う空間にします。<br>香りの強さが調節できます。<br>ラベルフィルムをはがせば、デザインすっきり。<br>また、お好みで下部フィルムデザインも残せます。<br> <br><br><br>使用方法<br>1.上ブタ全体をまわしてはずす。<br>2.白キャップのみはずして捨てる。<br>3.上ブタを元どおりセットし、安定した場所に置く。<br>*上ブタの中の白い「ろ紙」は取り出さない。<br> <br><br>使用上の注意<br>●幼児の手の届くところに置かない。<br>●液が目に入った場合は、充分流水で洗う。<br>皮膚についた場合は石けんでよく洗う。<br>いずれの場合も異常がある時は医師に相談する。<br>●液がしみ出るので倒さない。<br>●万一、液がこぼれた場合はすぐに拭き取る。<br>●高温になる所や、直射日光の当たるところには置かない。<br>●持ち運びの際は、ボトル部分を持つ。<br>●天然成分配合のため、ろ紙がわずかに着色することがありますが性能上問題ありません。<br>●用途以外に使用しない。<br> <br>成分<br>ミネラル消臭剤、植物精油、香料、界面活性剤(非イオン、陰イオン) 用途室内用<br> 原産国日本 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／消臭剤全部<br>JANコード： 4901070118649<br><br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
