お部屋の消臭力 香りstyle ふんわりエンジェルブロッサム 400ml<br>ブランド：お部屋の消臭力<br>販売・製造元：エステー<br><br>ナノパウダー配合で、すばやく強力に消臭する消臭剤です。<br>消臭された空間に、香りがしっかり広がります。<br>季節や使用状況により異なりますが、効果は通常約2-3カ月持続します。<br> <br><br><br>使用方法<br>※上ブタの中の白いろ紙は取り出さない。<br>(1)上ブタ全体を回してはずす。<br>(2)内キャップのみはずして捨てる。<br>(3)上ブタを元どおりセットする。<br>●効果をアップしたい時・・・調節部分を上へ引き上げる(上げ下げで調節できます)。<br>※通常より使用期間が短くなります。<br> 使用期間通常約2-3ヶ月間持続します。<br>(季節や使用状況により異なる) <br><br>使用上の注意<br>●幼児の手の届くところに置かない。<br>●液が目に入った場合は充分流水で洗う。<br>皮膚についた場合は石けんでよく洗う。<br>異常のある時は医師に相談する。<br>●安定した場所に置く。<br>●液がしみ出るので倒さない。<br>液が付着すると塗装面や床がシミになったり、変色の恐れがあるのですぐに拭き取る。<br>●高温になる所や直射日光の当たる所には置かない。<br>●ろ紙がわずかに着色することがありますが、性能上問題ありません。<br>●用途以外に使用しない。<br> 品質表示●成分：無機系消臭剤、植物精油、香料、界面活性剤(非イオン、陰イオン)●用途：室内用<br> 原産国日本 <br><br>お問い合わせ先<br>エステー株式会社 お客様相談室TEL：03-3367-2120 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／消臭剤全部<br>JANコード： 4901070122769<br><br>CS：18<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
